import React from 'react';
import styles from './Footer.module.scss';

const Footer = () => {
  return (
    <footer className={styles.footer}>
      <p>Виробництво студії "M-G-Master"</p> Всі права захищені &copy;
    </footer>
  );
};

export default Footer;
